import React, { Component } from 'react'

export default class Registration extends Component {
    state = {
        name: '',

    }
    render() {
        return (
            <div className="registration">
                <h2 className="registration__title">Create account</h2>
                <span>Your name</span>
                <input className="registration-input" type="text" required/>
                <span>Surname</span>
                <input className="registration-input" type="text" required/>
                <span>Email</span>
                <input className="registration-input" type="text" required/>
                <span>Phone number</span>
                <input className="registration-input" type="text" required/>
                <span>Password</span>
                <input className="registration-input" type="password" required/>
                <button className="registration__button"></button>
            </div>
        )
    }
}
